import React from 'react'
import { useNavigate } from 'react-router-dom'

export const HomePage = () => {

    const navigate = useNavigate();

    const handleAdmin = () => {
        navigate('/adminLog')
    };

    const handleMngr = () => {
        navigate('/managerLog')
    };

  return (
    <div>
        <form>
            <h1>Login as:</h1>
            <div>
                <button onClick={handleAdmin}>Admin</button>
                <button onClick={handleMngr}>Manager</button>
            </div>
        </form>
    </div>
  )
}
